const Jumbotron = () => (
  <div style={{ background: 'transparent !important' }} className="jumbotron">
    <h1>Welcome to Upbase Ltd News</h1>
    <p>
      We're an awesome company that creates virtual things for portable devices.
    </p>
  </div>
);
export default Jumbotron;
